import React from "react"
import "./fundoPreto.css"

function Home(props) {
    const { name } = props
    return (
        <button className="fundoPreto">{name}</button>
    )
}

function Following(props) {
    const { name } = props
    return (
        <button classname="fundoPreto">{name}</button>
    )
}

export default Home
export {Following}
